/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 900px;
    height: 500px;
    display: flex;
    flex-direction: column;
    gap: 15px;
    border: 2px solid #333;
    padding: 15px;
}
.row {
    display: flex;
    gap: 15px;
    flex: 1;
}
.item {
    flex: 1;
    padding: 12px;
    box-sizing: border-box;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
    overflow: hidden;
}
h4 {
    margin-bottom: 10px;
    font-size: 14px;
    color: #495057;
    border-bottom: 1px solid #dee2e6;
    padding-bottom: 4px;
}
.content-block {
    margin: 8px 0;
    padding: 8px;
    background-color: #ffffff;
    border: 1px solid #e9ecef;
    border-radius: 3px;
}
ul, ol {
    margin: 6px 0;
    padding-left: 18px;
}
li {
    margin: 2px 0;
    font-size: 12px;
}
table {
    width: 100%;
    border-collapse: collapse;
    font-size: 11px;
    margin: 6px 0;
}
th, td {
    border: 1px solid #dee2e6;
    padding: 3px 5px;
    text-align: left;
}
th {
    background-color: #e9ecef;
}
.code-snippet {
    font-family: 'Courier New', monospace;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
    padding: 6px;
    margin: 6px 0;
    font-size: 11px;
    border-radius: 2px;
}
.highlight {
    background-color: #fff3cd;
    padding: 1px 3px;
    font-weight: bold;
}
.nested-flex {
    display: flex;
    gap: 8px;
    margin: 6px 0;
}
.nested-item {
    flex: 1;
    padding: 6px;
    background-color: #e9ecef;
    border: 1px solid #adb5bd;
    font-size: 11px;
    text-align: center;
}
a {
    color: #0d6efd;
    text-decoration: none;
}
p {
    margin: 4px 0;
    font-size: 12px;
    line-height: 1.4;
}
